

import { jsPDF } from "jspdf";




export const EnvoicePage = (selected) => {


  // console.log(selected);

  let data = []

  selected.orders.map(order => {
    data.push({
      Cantidad: order.quantity.toString(),
      Talle: order.size.toString(),
      Descripcion: `${order.name} / ${order.color} / ${order.variant}`,
      Precio: `$ ${new Intl.NumberFormat().format(order.price).toString()}`,
      Total: `$ ${new Intl.NumberFormat().format(order.subTotal).toString()}`
    })
  });


  const Myheaders = [
    {
      id: "Cantidad",
      name: "Cantidad",
      prompt: "Cantidad",
      width: 33,
      align: "center",
      padding: '0'
    },
    {
      id: "Talle",
      name: "Talle",
      prompt: "Talle",
      width: 25,
      align: "center",
      padding: '0'
    },
    {
      id: "Descripcion",
      name: "Descripcion",
      prompt: "Descripcion",
      width: 145,
      align: "center",
      padding: '0'
    },
    {
      id: "Precio",
      name: "Precio",
      prompt: "Precio",
      width: 30,
      align: "center",
      padding: '0'
    },
    {
      id: "Total",
      name: "Total",
      prompt: "Total",
      width: 30,
      align: "center",
      padding: '0'
    }
  ];

  const myLogo = './logoR40.png'


  const doc = new jsPDF();

  doc.setFontSize(15)
  doc.setFont('helvetica', 'bold');
  doc.text('Cliente:', 10, 15);

  doc.setFont('helvetica', 'normal');
  doc.text(`${selected.Client}`, 30, 15);

  doc.setFontSize(20)
  doc.setFont('helvetica', 'bold');
  doc.text('Total:', 140, 25);

  doc.setFontSize(35)
  doc.setFont('helvetica', 'normal');
  doc.text(`$ ${new Intl.NumberFormat().format(selected.TotalPrice)}`, 140, 40);



  doc.setFontSize(15)
  doc.setFont('helvetica', 'bold');
  doc.text('Ubicacion:', 10, 25);

  doc.setFont('helvetica', 'normal');
  //todo: Tengo que agregar el lugar en orders/selected 
  doc.text(`Purmamarca`, 38, 25);

  var myimg = 'data:image/jpeg;base64,'
  
  doc.addImage(myimg, "JPEG", 80, 5, 50, 50);



  doc.table(6.5, 60, data, Myheaders, { autoSize: false, margins: { right: 10, left: 10, top: 40, bottom: 40 } });

  doc.save("a4.pdf")

  doc.autoPrint();

  // return doc



}



